import React from 'react';

const CTA = ({ onSignInClick }) => {
  return (
    <section className="cta" id="cta">
      <h2>Ready to Transform Your Workflow?</h2>
      <p className="cta-subtitle">
        Join thousands of professionals who have already supercharged their productivity with Digital Dockers' AI-powered tools.
      </p>
      {/* This button can be linked to a sign-up or your main app */}
      <button className="cta-button" onClick={onSignInClick}>
        Start Your Journey
      </button>
    </section>
  );
};

export default CTA;
